class Json{constructor(t){this.adapter=t}async get(t){return this.adapter.get(t)}async insert(t,e){return this.adapter.insert(t,e)}async update(t,e,a){return this.adapter.update(t,e,a)}async delete(t,e){return this.adapter.delete(t,e)}async createSchema(t){return this.adapter.createSchema(t)}async close(){return this.adapter.close()}}class Sql{constructor(t){this.adapter=t}async get(){return this.adapter.get()}async insert(t,e){return this.adapter.insert(t,e)}async update(t,e,a){return this.adapter.update(t,e,a)}async delete(t,e){return this.adapter.delete(t,e)}async createSchema(t,e){return this.adapter.createSchema(t,e)}async close(){return this.adapter.close()}}class OrbDB{static Json=Json;static Sql=Sql}export default OrbDB;